import React from 'react';
import { Routes, Route } from 'react-router-dom';
import WelcomeScreens from './pages/WelcomeScreens';
import Dashboard from './pages/Dashboard';
import Payment from './components/Payment';
import Confirmation from './components/Confirmation';
import Profile from './pages/Profile'; // Импортируйте компонент Profile

const App: React.FC = () => {
  return (
    <Routes>
      <Route path="/" element={<WelcomeScreens />} />
      <Route path="/dashboard" element={<Dashboard />} />
      <Route path="/payment" element={<Payment />} />
      <Route path="/confirmation" element={<Confirmation />} />
      <Route path="/profile" element={<Profile />} /> {/* Добавьте маршрут для профиля */}
      <Route path="/login" element={<Login />} /> {/* Убедитесь, что у вас есть компонент Login */}
    </Routes>
  );
};

export default App;
